import PropTypes from 'prop-types'

function Key(props) {

    function handleClick() {

        props.onClick(props.keyValue)
    }

    return (
            <li 
                key={props.keyValue}
                className="key"  
                onClick={handleClick}>
                    {props.keyValue}
            </li>
    )
}

Key.propTypes = {

    keyValue: PropTypes.string.isRequired,
    state: PropTypes.oneOf(['none', 'matched', 'mismatched']),
    onClick: PropTypes.func.isRequired
}

export default Key
